  useEffect(() => {
    document.title = "Home Page";
  }, []);
  return (
    <>
      <HeroSection />
      <div style={{display:"flex" , flexDirection:"column"}}> 
      <ViewCourse />
      </div>
    </>
  );
}
export default Home;
